import React from 'react'
import Togglable from './Togglable'
import BlogInfo from './BlogInfo'

const Blog = ({blog}) => (
  <div>
    <div>
      {blog.title} {blog.author}
    </div>
    <Togglable buttonLabel="test">
      <BlogInfo 
        author={blog.author}
        user={blog.user}
        likes={blog.likes}
        url={blog.url}
        title={blog.title} />
    </Togglable>
  </div>
)


export default Blog
